import React from 'react';
import styled from 'styled-components';

const StyledLi = styled.li`
list-style: none;
background: blue;
color: white;
`

const StyledBtn = styled.button`
position: absolute;
`


const Todo = ({todo, onclick}) => {
    return(
        <>
        <StyledLi>{todo}</StyledLi>
        <StyledBtn onClick={onclick}>X</StyledBtn>
        </>
    ) 
}; 

export default Todo;
